                    <img src={sassLogo} alt="Sass" />
                    <img src={nodeLogo} alt="Node.js" />
                    <img src={sqlLogo} alt="SQL" />
                    <img src={csharpLogo} alt="C#" />
                </div>
            </div>
            <div className="skills-soft">
                <h2 className='soft-skills-title'>{translations.softSkillsTitle}</h2>
